func minimumLength(_ s: String) -> Int {
  guard s.count > 1 else { return s.count }
  let pre = s.prefix(1)
  let suf = s.suffix(1)
  
  // Front and back should be the same. Otherwise we can't subtract more items
  guard pre == suf else { return s.count }
  guard pre == suf, s.count > 2 else { return 0 }
  
  let regex = try! Regex("(\(pre)+)")
  let matches = s.ranges(of: regex)
  
  if let first = matches.first, let last = matches.last, last.upperBound == s.endIndex && first.lowerBound == s.startIndex {
    if last.lowerBound <= first.upperBound {
      return minimumLength("")
    }
    
    let simplified = s[first.upperBound..<last.lowerBound]
    return minimumLength(String(simplified))
  }

  return minimumLength(s)
}

